        [TestMethod]
        public void ParseKWItem()
        {

            var lineItem =
                @"<KWH DELIVERED TIME: 03-23-2015 00:00 VALUE: 11.057>";
            
            
            if (lineItem.StartsWith("<KWH RECEIVED"))
            {
                //string[] items = dataset.Split(new string[] { ' ' }, StringSplitOptions.RemoveEmptyEntries);
                var dtString = Between(lineItem, "TIME:", "VALUE:");

                DateTime dtValue;
                DateTime.TryParse(dtString, out dtValue);

                var doubleString = Between(lineItem, "VALUE:", ">");
                Double doubleVal;
                Double.TryParse(doubleString, out doubleVal);

                var kwItem = new KwhiTem(KWItemType.RECEIVED, dtValue, doubleVal);
                Assert.AreEqual(new DateTime(2015,3,23,0,0,0), kwItem.ItemDate);
            }
            

        }

        public static string Between(string value, string a, string b)
        {
            int posA = value.IndexOf(a);
            int posB = value.LastIndexOf(b);
            if (posA == -1)
            {
                return "";
            }
            if (posB == -1)
            {
                return "";
            }
            int adjustedPosA = posA + a.Length;
            if (adjustedPosA >= posB)
            {
                return "";
            }
            return value.Substring(adjustedPosA, posB - adjustedPosA);
        }
